    function calculateSalaryComponents(uint256 annualSalary) public pure returns (
        uint256 monthly,
        uint256 tax,
        uint256 ni,
        uint256 net
    ) {
        monthly = annualSalary / 12;
        tax = (monthly * TAX_RATE) / 100;
        ni = (monthly * NI_RATE) / 100;
        net = monthly - tax - ni;
        return (monthly, tax, ni, net);
    }

