    function calculateTax(uint256 grossSalary) public view returns (uint256) {
        for (uint i = 0; i < taxSlabs.length; i++) {
            if (grossSalary >= taxSlabs[i].min && grossSalary < taxSlabs[i].max) {
                return (grossSalary * taxSlabs[i].rate) / 100;
